import React from 'react';

import Sidebar from 'react-sidebar';

const sidebar = (props) => {
    return (
        <Sidebar
          sidebar={
            <b>Sidebar content</b>
          }
          open={props.open}
          onSetOpen={props.onSetSidebarOpen}
          styles={{ sidebar: { background: "white" } }}
        >
          <button onClick={() => props.toggle()}>
            Open sidebar
          </button>
        </Sidebar>
      );
};

export default sidebar;
